  `tem3` int(3) DEFAULT '0' COMMENT '温度值3',
  `tem4` int(3) DEFAULT '0' COMMENT '温度值4',
  `ACurrent` int(3) DEFAULT '0' COMMENT 'A相电流',
  `BCurrent` int(3) DEFAULT '0' COMMENT 'B相电流',
  `CCurrent` int(3) DEFAULT '0' COMMENT 'C相电流',
  `AVoltage` int(3) DEFAULT '0' COMMENT 'A相电压',
  `BVoltage` int(3) DEFAULT '0' COMMENT 'B相电压',
  `CVoltage` int(3) DEFAULT '0' COMMENT 'C相电压',
  `leakageCurrent` int(4) DEFAULT '0' COMMENT '漏电流',
  `AVoltageUpLimit` int(5) DEFAULT '0' COMMENT 'A相电压上限阀值',
  `leakageCurrentUpLimit` int(5) DEFAULT '0' COMMENT '漏电流上限',
  `BVoltageUpLimit` int(5) DEFAULT '0' COMMENT 'B相电压上限阀值',
  `CVoltageUpLimit` int(5) DEFAULT '0' COMMENT 'C相电压上限阀值',
  `AVoltageDownLimit` int(5) DEFAULT '0' COMMENT 'A相电压下限阀值',
  `BVoltageDownLimit` int(5) DEFAULT '0' COMMENT 'B相电压下限阀值',
  `CVoltageDownLimit` int(5) DEFAULT '0' COMMENT 'C相电压下限阀值',
  `ACurrentUpLimit` int(5) DEFAULT '0' COMMENT 'A相电流上限',
  `BCurrentUpLimit` int(5) DEFAULT '0' COMMENT 'B相电流上限',
  `CCurrentUpLimit` int(5) DEFAULT '0' COMMENT 'C相电流上限',
  `over_voltage_warning` varchar(20) DEFAULT '' COMMENT '过压告警',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of hixent_arc_equipment_info
