-- ----------------------------
-- Table structure for `hixent_arc_equipment_info_mqtt`
-- ----------------------------
DROP TABLE IF EXISTS `hixent_arc_equipment_info_mqtt`;
CREATE TABLE `hixent_arc_equipment_info_mqtt` (
  `id` varchar(16) NOT NULL DEFAULT '0' COMMENT '终端唯一编号',
  `module_code` varchar(10) NOT NULL DEFAULT '0' COMMENT '模块编号',
  `line_code` varchar(10) NOT NULL DEFAULT '0' COMMENT '总线编号',
  `device_code` varchar(10) NOT NULL DEFAULT '0' COMMENT '设备编号',
  `site_code` varchar(10) NOT NULL DEFAULT '0' COMMENT '站点编号',
  `city_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '市id',
  `province_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '省id',
  `area_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '区id',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '详细地址',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0在线，1离线',
  `is_effect` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0未损坏1已经损坏',
  `register_time` int(10) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `addr` varchar(50) NOT NULL DEFAULT '' COMMENT '地址（有线）',
  `subtype` varchar(2) NOT NULL DEFAULT '' COMMENT '子类型',
  `equipment_manufacturer_code` varchar(10) NOT NULL DEFAULT '' COMMENT '设备厂商代码',
  `equipment_category` tinyint(1) NOT NULL DEFAULT '1' COMMENT '''设备类别 1：电弧探测器 2：剩余电流 3：测温式''',
  `equipment_type` varchar(255) NOT NULL DEFAULT '' COMMENT '设备型号。1：AFDD-1000B 2：AFDD-1000N',
  `equipment_production_sequence_number` varchar(255) NOT NULL DEFAULT '' COMMENT '生产序列号',
  `longitude` varchar(50) NOT NULL DEFAULT '' COMMENT '百度经度',
  `latitude` varchar(50) NOT NULL DEFAULT '' COMMENT '百度维度',
  `software_version` varchar(50) NOT NULL DEFAULT '' COMMENT '软件版本',
  `hardware_version` varchar(50) NOT NULL DEFAULT '' COMMENT '硬件版本',
  `issue_time` varchar(50) NOT NULL DEFAULT '' COMMENT '发行时间',
  `boot_version_number` varchar(50) NOT NULL DEFAULT '' COMMENT '引导版本号',
  `version_information` varchar(10) NOT NULL DEFAULT '' COMMENT '版本信息',
  `message` varchar(255) NOT NULL DEFAULT '' COMMENT '描述符',
  `nb_category` tinyint(1) NOT NULL DEFAULT '0' COMMENT '类别 1:全网通 2:中国移动  3:中国电信  4:中国联通',
  `nb_chip_type` varchar(50) NOT NULL DEFAULT '' COMMENT '芯片型号',
  `nb_chip_serial_number` varchar(255) NOT NULL DEFAULT '' COMMENT '芯片序号',
  `nb_phone_number` varchar(50) NOT NULL DEFAULT '' COMMENT '电话号码',
  `server_ip_address` varchar(50) NOT NULL DEFAULT '' COMMENT '服务器IP地址',
  `server_port_number` int(8) NOT NULL DEFAULT '0' COMMENT '服务器端口号',
  `standby_server_ip_address` varchar(20) NOT NULL DEFAULT '' COMMENT '备用服务器IP地址',
  `standby_server_port_number` int(8) NOT NULL DEFAULT '0' COMMENT '备用服务器端口',
  `seartbeat_time` varchar(50) NOT NULL DEFAULT '' COMMENT '心跳时间',
  `voluntary_reporting` varchar(2) NOT NULL DEFAULT '' COMMENT '主动上报',
  `device_restart` varchar(2) NOT NULL DEFAULT '' COMMENT '设备重启',
  `restore_factory` varchar(2) NOT NULL DEFAULT '' COMMENT '恢复出厂化',
  `make_formal_model` tinyint(1) NOT NULL DEFAULT '0' COMMENT '工作模式',
  `make_formal_debugging` tinyint(1) NOT NULL DEFAULT '0' COMMENT '通讯方式',
  `alarm_sound` tinyint(1) NOT NULL DEFAULT '1' COMMENT '报警音: 模式1  模式2  模式3  模式4',
  `arc_warning_sensitivity` varchar(10) NOT NULL DEFAULT '' COMMENT '电弧告警灵敏度',
  `arc_time_range` varchar(10) NOT NULL DEFAULT '' COMMENT '电弧时间范围',
  `arc_number` varchar(20) NOT NULL DEFAULT '' COMMENT '电弧次数',
  `temperature_warning_threshold` varchar(20) NOT NULL DEFAULT '' COMMENT '温度告警门限',
  `leakage_warning_threshold` varchar(20) NOT NULL DEFAULT '' COMMENT '漏电告警门限',
  `buzzer_enabler` tinyint(1) NOT NULL DEFAULT '1' COMMENT '蜂鸣器使能',
  `fire_warning_enabler` tinyint(1) NOT NULL DEFAULT '1' COMMENT '电弧预警使能',
  `high_temperature_warning_enabler` tinyint(1) NOT NULL DEFAULT '1' COMMENT '高温告警使能',
  `leakage_alarm_enabler` tinyint(1) NOT NULL DEFAULT '1' COMMENT '漏电告警使能',
  `arc_relay` tinyint(1) NOT NULL DEFAULT '1' COMMENT '电弧继电器使能',
  `over_temperature_relay` tinyint(1) NOT NULL DEFAULT '1' COMMENT '过温继电器使能',
  `leakage_relay` tinyint(1) NOT NULL DEFAULT '1' COMMENT '漏电继电器使能',
  `alarm_reset` varchar(2) NOT NULL DEFAULT '' COMMENT '告警重置',
  `alarm_silencing` varchar(2) NOT NULL DEFAULT '' COMMENT '消音',
  `fire_alarm` tinyint(1) NOT NULL DEFAULT '0' COMMENT '电弧预警',
  `over_temperature_alarm` tinyint(1) NOT NULL DEFAULT '0' COMMENT '超温告警',
  `leakage_alarm` tinyint(1) NOT NULL DEFAULT '0' COMMENT '漏电告警',
  `temperature_value` varchar(10) NOT NULL DEFAULT '' COMMENT '温度值',
  `current_value` varchar(10) NOT NULL DEFAULT '' COMMENT '电流值',
  `arcrelay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '电弧继电器',
  `overtemprelay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '过温继电器',
  `leakagerelay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '漏电继电器',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

