  `warning_no` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '告警id',
  `warning_index` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0电弧预警，1设备故障，2设备离线',
  `warning_type` varchar(50) NOT NULL DEFAULT '' COMMENT '报警类型名称',
  `warning_time` int(11) NOT NULL DEFAULT '0' COMMENT '报警时间',
  `is_deal` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否处理  0 未处理 1已处理 2 待审核',
  `dispatch_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '派单时间(最新的处理时间)',
  `eid` varchar(16) NOT NULL DEFAULT '' COMMENT '设备终端编号',
  `etype` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '设备类型。0无线1有线主机2有线终端',
  `lng_bmap` double(15,10) DEFAULT '119.1234567890' COMMENT '百度精度',
  `lat_bmap` double(15,10) DEFAULT '26.1234567890' COMMENT '维度',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '设备详细地址',
  `app_name` varchar(50) NOT NULL DEFAULT '' COMMENT '处理人员名称',
  `app_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '处理人员工号',
  `admin_id` int(10) NOT NULL DEFAULT '0' COMMENT '对应的管理员工号',
  `admin_name` varchar(50) NOT NULL DEFAULT '' COMMENT '管理员姓名',
  `node` text COMMENT '备注',
  `efm_id` varchar(50) NOT NULL DEFAULT '' COMMENT 'efm-6000设备ID',
  `isDispatch` tinyint(3) DEFAULT '0' COMMENT '是否派单，0否 1是',
  `isReset` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否设备复位 0否1设备复位',
  PRIMARY KEY (`warning_no`)
) ENGINE=InnoDB AUTO_INCREMENT=4752 DEFAULT CHARSET=utf8 COMMENT='--电弧 报警列表';

